import * as React from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import {Typography} from '@mui/material';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';
import { Link, useNavigate } from 'react-router-dom';


export default function UserHistory() {
  const [data, setData] = React.useState([]);
  const [email, setEmail] = React.useState('');
  const navigate = useNavigate();

  React.useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (userEmail) {
      setEmail(userEmail);
    }
  }, []);

  React.useEffect(() => {
    if (email) {
      fetchData();
    }
  }, [email]);

  const fetchData = async () => {
    try {
      const response = await axios.get(`http://localhost:3001/userHistory?Email=${email}`);
      setData(response.data);
    } catch (error) {
      console.error("Error", error);
    }
  };

  const handleClick = () => {
    navigate('/');
    localStorage.removeItem('userEmail');
  };

  return (
    <>
      <header>
        <Link to="/" className="logo"><h2>GlucoWise</h2></Link>
        <nav className="navigation">
          <Link to="/">Home</Link>
          <Link to="/userHistory">User History</Link>
          <Link to="#">Feedback</Link>
          <Link to="#">About</Link>
          <button onClick={handleClick} className="loginbtn">Logout</button>
        </nav>
      </header>
      <div>
        {data.map((item, index) => (
          <Accordion key={index}>
            <AccordionSummary
              expandIcon={<ArrowDownwardIcon />}
              aria-controls={`panel${index + 1}-content`}
              id={`panel${index + 1}-header`}
            >
              <Typography>User Entry {index + 1}</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <Typography>
                Diabetes in Heredity: {item.Heredity === 1 ? 'Yes' : 'No'}<br />
                Duration of Physical Activity: {item.PhysicalActivity} minutes<br />
                Frequency of Fast Food: {item.FastFood}<br />
                Glucose level: {item.Glucose} mg/dL<br />
                Blood Pressure level: {item.BloodPressure} mmHg<br />
                BMI: {item.BMI} kg/m2<br />
                Age: {item.Age} years<br />
                Prediction: {item.Outcome} %
              </Typography>
            </AccordionDetails>
          </Accordion>
        ))}
      </div>
    </>
  );
}
